def organize_plug_types(plug_list):
    plug_dict = {}
    for plug in plug_list:
        parts = plug.split('-')
        voltage = parts[1].split('V')[0]
        phase = parts[2]
        connector = parts[3]
        key = (voltage, phase, connector)
        if key not in plug_dict:
            plug_dict[key].append(plug)
        else:
            plug_dict[key] = [plug]
    return plug_dict

